const inputIdx = 1;
const part1 = true;
const part2 = true;

const ACodePoint = 'A'.codePointAt(0);
const ZCodePoint = 'Z'.codePointAt(0);
const aCodePoint = 'a'.codePointAt(0);

const pairs = [];
for (let cp = ACodePoint; cp <= ZCodePoint; cp++) {
  pairs.push(String.fromCodePoint(cp, cp + aCodePoint - ACodePoint));
  pairs.push(String.fromCodePoint(cp + aCodePoint - ACodePoint, cp));
}

function getPolymerLength(input) {
  let polymer = input;
  let found = true;
  while (found) {
    found = false;
    for (const pair of pairs) {
      if (polymer.includes(pair)) {
        found = true;
        polymer = polymer.replace(pair, '');
      }
    }
  }
  return polymer.length;
}

function solve1(input) {
  console.log(getPolymerLength(input));
}

function solve2(input) {
  let minLength = input.length;
  for (let cp = ACodePoint; cp <= ZCodePoint; cp++) {
    const polymer = input.replace(
      new RegExp(
        `[${String.fromCodePoint(cp, cp + aCodePoint - ACodePoint)}]`,
        'g'
      ),
      ''
    );
    const length = getPolymerLength(polymer);
    if (length < minLength) {
      minLength = length;
    }
  }
  console.log(minLength);
}

const inputs = [];

inputs.push(`dabAcCaCBAcCcaDA`);

inputs.push(
  ``
);

part1 && solve1(inputs[inputIdx]);
part2 && solve2(inputs[inputIdx]);
